export default {
  name: 'c-pageBanner',
  props: {
    imgMap: {
      type: Object,
      default: () => {},
      required: true,
    },
    title: {
      type: String,
      default: '帮助中心',
    },
    className: {
      type: [String, Array],
      default: '',
    },
    backgroungImgUrl: {
      type: String,
      default: '',
    },
    styles: {
      type: Object,
      default: () => {},
    },
  },
  computed: {
    bannerStyle() {
      const { imgMap } = this;
      let style = {};
      style.background = `url(${imgMap.inforHeadBg})`;
      if (this.backgroungImgUrl) {
        style.background = `url(${this.backgroungImgUrl})`;
      }
      if (this.styles) {
        style = Object.assign(style, this.styles);
      }
      return style;
    },
  },
};
